function Add(a,b){

    var sum = (a+b);
    return sum;

}

function Sub(a,b){

    var sub = (a-b);
    return sub;

}
function mult(a,b){

    var mult = (a*b);
    return mult;
}

function div(a,b){

    var div = (a/b);
    div = div.toFixed(2);
    return div;
}
export {Add,Sub,mult,div};
